import React from 'react';
import './AccommodationCard.less';
import { Image, Card } from 'antd';

type AccommodationCardType = {
  accommodation: {
    id: number,
    price: number,
    description: string,
    floor: number,
    maxFloor: number,
    roomCount: number,
    address: string,
  };
};

const AccommodationCard: React.FC<AccommodationCardType> = ({ accommodation }: AccommodationCardType) => (
  <div className="benefit">
    <Card
      cover={(
        <Image.PreviewGroup>
          <Image width={200} height={200} src="https://cdn.pixabay.com/photo/2016/06/24/10/47/house-1477041_960_720.jpg" />
          <Image width={200} height={200} src="https://cdn.pixabay.com/photo/2016/06/24/10/47/house-1477041_960_720.jpg" />
        </Image.PreviewGroup>
      )}
    >
      test
    </Card>
  </div>
);

export default AccommodationCard;
